import React from 'react';
import './Card.css';

export default function Card(props) {
  // acá va tu código
  return (
    <div className="card text-white bg-dark lead" >
    <div className="card-header">
    <button id='closeIcon' className='lead' onClick={props.onClose}>X</button>
    {props.name}
    </div>
    <div className="card-body">
      <div className=" row card-title">
        <div className='col-sm-4 col-md-4 col-lg-4 lead'>
          <h4>Min</h4>
          <p>{props.min}°</p>
        </div>
        <div className='col-sm-4 col-md-4 col-lg-4 lead'> 
          <h4>Max</h4>
          <p>{props.max}°</p>
        </div>
        <div className='col-sm-4'>
        <img src={`http://openweathermap.org/img/wn/${props.img}@2x.png`} alt="Imagen de clima"/>
        </div>
    </div>
  </div>
  </div>
    )
};
